import React, { Component } from 'react'

class Login extends Component {
     constructor(props){
          super(props)

          this.email = null
          this.passwd = null
     }
     render(){
          return(
               <div>
                    <input type='email' ref />
                    <input type='passwd' />
                    <button onClick={() => console.log('clicou')}> Entrar </button>
               </div>
          )
     }
}
export default Login
